//lh3.googleusercontent.com/d9mz-OKghOQPsgxRv1BQzQAI44ifiA_6aAk-gRwo4_32mZXM-TSd5vIY1rL1P2LUH9mFQPnUSRE=h28-rw" }, { "type": "news", "url": "https://indianexpress.com/article/cities/chennai/orange-alert-december-2-3-met-department-predicts-heavy-rainfall-9047253/", "text": "Orange Alert in Chennai on December 2 and 3 as MeT department predicts heavy to very heavy rainfall", "image": "https://images.indianexpress.com/2023/11/chennai-rain.jpg", "sitelogo": "https://lh3.googleusercontent.com/kkBP5GMG7WhGg_OaGvdoYp6jxPdIe5_HE4NLhmd8-80hpps2K2BcHM47_XxnxBo9ub0jbx1ZZQ=h28-rw" }] }, { "index": 4, "keywords": "tunnel workers Uttarakhand How", "headline": "41 Rescued After 17-Day Ordeal in Uttarakhand Tunnel.", "summary": ["Vaqeel Hasan, head of Rockwell Enterprises, praises the diversity of faiths in his team that rescued 41 trapped workers.", "The 12-man team dug 12 metres in cramped pipes over 26-27 hours to reach the trapped men.", "Hasan and his team worked for free, motivated by the pressure to save lives."], "social": [{ "type": "news", "url": "https://www.aljazeera.com/news/2023/11/29/how-rat-miners-rescued-workers-from-indian-tunnel-after-17-days", "text": "How rat miners rescued workers from Indian tunnel after 17 days", "image": "https://www.aljazeera.com/wp-content/uploads/2023/11/2023-11-28T212138Z_175062671_RC2LM4A530Q4_RTRMADP_3_INDIA-TUNNEL-COLLAPSE-1701247451.jpg?resize=1920%2C1440", "sitelogo": "https://e7.pngegg.com/pngimages/701/785/png-clipart-al-jazeera-english-al-jazeera-documentary-channel-al-jazeera-media-network-news-arabic-calligraphy-television-text.png" }, { "text": "NDRF Mock drill on how the NDRF men will rescue the 41 trapped workers through the pipe that is being laid inside the tunnel in Uttarkashi. Prayers for all the workers who have been trapped since last 13 days. #Uttarakhand", "image": "https://pbs.twimg.com/amplify_video_thumb/1728015943589134336/img/lcyvA9R1VB9_eODT.jpg", "handle": "@AdityaRajKaul", "name": "Aditya Raj Kaul", "profilePic": "https://pbs.twimg.com/profile_images/1710325511208185856/NxnmQ8c1_x96.jpg", "sitelogo": "https://www.freepnglogos.com/x-logo-twitter-transparent-logo-download-3.png", "url": "https://twitter.com/AdityaRajKaul/status/1728016022601404608", "type": "TweetWithImage" }, { "type": "news", "url": "https://www.ndtv.com/india-news/uttarakhand-tunne-viral-video-arnold-dix-rescuers-jubilant-after-17-day-tunnel-operation-pays-off-4619590", "text": "17-Day Ordeal, Massive Rescue Op, Then A Dance: Uttarakhand Tunnel Tales", "image": "https://c.ndtvimg.com/2023-11/1doajaso_uttarakhand-rescuer-dance_625x300_30_November_23.jpeg?ver-20231128.06", "sitelogo": "https://logonoid.com/images/ndtv-logo.png" }, { "text": "Shameless cover up:\nToday is the 11th day that over 40 workers have been trapped in a collapsed tunnel in Uttarakhand.\nSeveral media outlets reported how there was an escape plan in the tunnel plans but it was never built.\nSo the Modi Govt issues a quiet threat to news channels asking to curb any negative coverage.\nLives of 40 workers don't matter to Modi.\nWhat matters is his own image & PR to hide his incompetence & his role in risking the lives of these innocents.", "image": "https://pbs.twimg.com/media/F_geiegaYAArCwK?format=jpg&name=medium", "handle": "@SaketGokhale", "name": "Saket Gokhale", "profilePic": "https://pbs.twimg.com/profile_images/1559126686477590534/4b9_tWXo_x96.jpg", "sitelogo": "https://www.freepnglogos.com/x-logo-twitter-transparent-logo-download-3.png", "url": "https://twitter.com/SaketGokhale/status/1727164048683553244", "type": "TweetWithImage" }, { "type": "news", "url": "https://indianexpress.com/article/india/uttarakhand-tunnel-rescue-hindus-muslims-together-saved-41-trapped-workers-9047959/", "text": "Hindus, Muslims together saved 41 workers in tunnel, says chief of firm that pulled off Uttarakhand rescue", "image": "https://images.indianexpress.com/2023/11/miners.jpeg", "sitelogo": "https://lh3.googleusercontent.com/kkBP5GMG7WhGg_OaGvdoYp6jxPdIe5_HE4NLhmd8-80hpps2K2BcHM47_XxnxBo9ub0jbx1ZZQ=h28-rw" }, { "text": "Uttarakhand Tunnel Collapse Timeline - Tragedy to Jubilation\nOn Nov 12, 41 workers were left trapped inside the Silkyara tunnel when a section of it collapsed due to a landslide. Here's how the #UttarakhandTunnelRescue unfolded:\n13th: Basic supplies like food, oxygen & water sent in as excavators begin moving debris - CM PS Dhami arrives\n14-15th: Auger machinery begins placing pipe as exit route for workers, families & colleagues urge for speed - debris begins to fall\n16-17th: New drill installed which cuts through 24m, however one of the pipes hits an obstacle. Significant cracking sound heard\n18-19th: Radio communication established, horizontal drilling continues - question arise over speed of progress\n20th: Modi calls CM Dhami for update, as trapped workers rely on dry food\n21-22nd: First video footage of workers stuck in tunnel gives renewed hope - drilling reaches 32m but metal obstacles prove major complication\n23-25th: Medical emergency team on standby for final push, but drilling hits major stumbling block - manual op to begin through final 10m\n26-27th: Vertical drilling underway but it's 86m to workers. 'Rat miners' go in to create narrow hole for smaller escape pipe - efforts could still take days\n28th: Final metres drilled through. All 41 workers are rescued and taken to hospital\n#UttarakhandTunnelRescue", "image": "https://pbs.twimg.com/amplify_video_thumb/1729548774656098304/img/5-MsL82M3Dq7xhuX.jpg", "handle": "@RT_India_news", "name": "RT_India", "profilePic": "https://pbs.twimg.com/profile_images/1577982060278448129/92XNp6Hz_x96.jpg", "sitelogo": "https://www.freepnglogos.com/x-logo-twitter-transparent-logo-download-3.png", "url": "https://twitter.com/RT_India_news/status/1729548836241313829", "type": "TweetWithImage" }, { "type": "news", "url": "https://timesofindia.indiatimes.com/city/dehradun/gabbar-singh-the-voice-of-trapped-tunnel-labourers/articleshow/